import React, { Component } from "react";
import CardNota from "./CardNota";

export class ListaDeNotas extends Component {
    render() {
        return (
            <ul>
                {Array.of("trabalho", "trabalho", "Estudos").map((categoria, index) => {
                    return (
                        <li key={index}>
                            <div>{categoria}</div>
                            <CardNota />
                        </li>
                    )
                })}
            </ul>
        )
    }
}


export default ListaDeNotas
